INSERT INTO `v_menu` VALUES ('1', '马利宝品牌', 'pinpai', '1', '2', '0', '1', '/malibu/upload/image/menu/201404/20140423001437_31903.jpg', '<p>\r\n	&nbsp;正如其白色瓶身上绘以棕榈树和加勒比红日，马利宝是350年朗姆酒制造历史上悠闲的一环。马利宝的故乡是西印度群岛朗姆酒酿酒厂，传统工艺和现代技术的结合使它与众不同。至今人们仍采用群岛上出产的甘蔗榨出的优质糖浆、纯净的泉水以及精选的酵母来促成发酵，最后的点睛之笔是椰汁和糖，这样就制成了顺滑清爽的朗姆酒。<br />\r\n&nbsp;<br />\r\n1980年，马利宝首次来到英国，被形容为“天堂般的味道”。两年后，随着它的广泛流行，这款烈酒也被销往欧洲其他国家。1983年马利宝登陆美国，被认为是“比朗姆更有趣的酒”。<br />\r\n&nbsp;<br />\r\n如今，马利宝已经成为世界上最畅销的加勒比海椰子朗姆酒，以其招牌的白色酒瓶和清新的风味著称于世。它可直接饮用，也可用于调配多姿多彩的鸡尾酒，让每一个平淡日子都变为迷人假日。马利宝独特的广告语“开启你的阳光海岸”，时刻向人们传递着加勒比海活力无限的生活态度。\r\n</p>', '1', '马利宝', null, null, '1398183295');
INSERT INTO `v_menu` VALUES ('2', '马利宝产品', 'chanpin', '3', '8', '0', '1', '', null, '1', null, null, null, '1398170924');
INSERT INTO `v_menu` VALUES ('3', '椰子味朗姆预调酒', 'yutiao', '4', '5', '2', '2', '/malibu/upload/image/menu/201404/20140423002309_68471.jpg', '马利宝近日为追求个性、创新的广大中国年轻消费者们，特别推出三款口感清爽、易于饮用的预调酒。<br />\r\n&nbsp;- 酷爽椰子风味<br />\r\n&nbsp;- 阳光柠檬风味（含椰子味）<br />\r\n&nbsp;- 热情可乐风味（含椰子味）<br />\r\n&nbsp;<br />\r\n由100%进口马利宝加勒比朗姆酒调制，独特的椰子风味带来清爽鲜活口感，马利宝椰子味朗姆预调酒再次向人们传递加勒比海活力无限与悠然自得的生活态度。<br />\r\n<br />\r\n快让一瓶冰镇马利宝椰子味朗姆预调酒带你感受热带加勒比的自由愉悦，乐活所有细胞。不论独饮，还是约上三五好友，无乐不作的你，岂能错过！ <br />\r\n<br />', '1', '椰子味朗姆预调酒', null, null, '1398183878');
INSERT INTO `v_menu` VALUES ('5', '媒体中心', 'zhongxin', '9', '14', '0', '1', '', null, '1', null, null, null, '1398170374');
INSERT INTO `v_menu` VALUES ('10', '朗姆酒', 'langmu', '6', '7', '2', '2', '/malibu/upload/image/menu/201404/20140423002458_72748.jpg', '全球排名第一的加勒比海椰子朗姆酒、以其白色酒瓶和清新风味著称于世；<br />\r\n产自加勒比海地区西印度群岛朗姆酒酿酒厂、具有加勒比海真实的风味；<br />\r\n世界上最古老的通过蒸馏生产的烈酒、也是350年朗姆酒制造历史上悠闲的一环；<br />\r\n原料：西印度群岛上出产的新鲜甘蔗汁、蔗糖或糖蜜以及纯净泉水。<br />\r\n<br />\r\n马利宝拥有丰饶圆润的椰子芳香和淡淡的烘焙香，味道就象饱满多脂的椰子，同时混合了香草和奶油冰淇淋。较低的酒精度（21%），更易于饮用。无论是纯饮，加冰块，或是按照个人喜好来调配，马利宝都令饮品充满了醉人的加勒比风情。', '1', '朗姆酒', null, null, '1398183992');
